def getWordsInLongestSubsequence(self, words: List[str], groups: List[int]):
    z = []
    for i in range(len(words)):
        a = set()
        for j in range(len(words[i])):
            a.add(words[i][j] + str(j))
        z.append(a)
    # print(z)

    x = []
    d = []
    for i in range(0, len(groups)):
        c = [words[i]]
        b = z[i]
        y = groups[i]
        for j in range(i + 1, len(groups)):
            if (groups[j] != y and len(words[j]) == len(c[-1]) and len(z[j] ^ b) == 2):
                c.append(words[j])
                y = groups[j]
                b = z[j]
        d.append(c)


    #print(d)
    return d


from collections import defaultdict


def merge_on_first_match(sets):
    result = []

    for current in sets:
        current = list(current)  # Ensure list order
        first_item = current[0]
        merged = False

        for i, prev in enumerate(result):
            if first_item in prev:
                idx = prev.index(first_item)
                # Cut previous set at match point (excluding match and after)
                prev = prev[:idx]
                # Merge and update result
                result[i] = prev + current
                merged = True
                break

        if not merged:
            result.append(current)

    return [set(r) for r in result]  # Convert back to sets if needed




